import React from "react";
import TableCell from "../TableCell/TabeCell";

const TableRow = ({ data }) => {
   const cells = data.map((cellData, index) => {
      if (cellData.rowNumber) {
         return <TableCell key={index} value={cellData.rowNumber} />;
      }
      return <TableCell key={index} value={cellData.value} />;
   });
   return <tr>{cells}</tr>;
};

export default TableRow;
